import * as React from 'react';
import Typography from '@mui/material/Typography';
import Pagination from '@mui/material/Pagination';
import Stack from '@mui/material/Stack';
import { Track } from '../types/Track';
// import * as React from 'react';
import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import CssBaseline from '@mui/material/CssBaseline';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import List from '@mui/material/List';
// import Typography from '@mui/material/Typography';
import Divider from '@mui/material/Divider';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import InboxIcon from '@mui/icons-material/MoveToInbox';
import MailIcon from '@mui/icons-material/Mail';
import { Autocomplete, Button, Grid, Paper, TextField } from '@mui/material';
import { ChangeEvent, useState } from 'react';
import { useSelector } from 'react-redux';
import { selectLevel } from '../redux/level/level.selector';
import { selectView } from '../redux/view/view.selector';
import { selectDayPart } from '../redux/dayPart/dayPart.selector';
import { selectCompany } from '../redux/company/company.selector';
import { Filter } from '../types/Filter.types';
import CardTrack from '../components/CardTrack';
export default function TrackFind(props:{tracks:Track[]|null, setDesc:(desc:string)=>void, setFilter:(filter:Filter)=>void}){
    const [page, setPage] = React.useState(1);
    const levels=useSelector(selectLevel)
    const views=useSelector(selectView)
    const token=localStorage.getItem('user')
    const dayParts=useSelector(selectDayPart)
    const companies=useSelector(selectCompany)
    const [tracks,setTracks]=useState<Track[]>([])
    const[filter,setFilter]=useState<Filter>({
      area:"north",
      level:"",
      company:"",
      dayPart:"",
      view:""
    })
    const [desc, setDesc]=useState("")
    const handleChange = (event: React.ChangeEvent<unknown>, value: number) => {
      setPage(value);
    };
    function filterTracks(){
        // let tempTracks=props.track
    }
  const areas=[
    "north"
    ,"center"
    ,"south"
  ]
  const onChangeEndler=(e:ChangeEvent<HTMLInputElement>)=>{
    console.log(e.target)
    let value=e.target.value
    setDesc(value)
}
const handleFilterSubmit=()=>{
  props.setFilter({...filter})
}
const handleDescSubmit=()=>{
  props.setDesc(desc)
}
const drawerWidth = 240;
    return <> 




        <Box sx={{ display: 'flex' }}>
          <CssBaseline />
          
          
            
            
          <Paper sx={{ position:"static",height:"100vh" ,paddingBottom:"10px"}}elevation={1} >
          {/* <Drawer
            sx={{
              width: drawerWidth,
              flexShrink: 0,
              '& .MuiDrawer-paper': {
                width: drawerWidth,
                boxSizing: 'border-box',
              },
              // zIndex:0,
              paddingTop:"100px",
              position:"static",
              
            }}
            variant="permanent"
            
            anchor="right"
             */}
          {/* > */}
            <Toolbar sx={{zIndex:-1}} >
             
            </Toolbar>
            {/* <Divider /> */}
            <List >
              {/* {['Inbox', 'Starred', 'Send email', 'Drafts'].map((text, index) => (
                <ListItem key={text} disablePadding>
                  <ListItemButton>
                    <ListItemIcon>
                      {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
                    </ListItemIcon>
                    <ListItemText primary={text} />
                  </ListItemButton>
                </ListItem>
              ))} */}
              <ListItem>
              <TextField id="outlined-basic" label="enter your description here" variant="outlined"
              value={desc}
             onChange={onChangeEndler}
             fullWidth
             /></ListItem>
             <ListItem>
             <Button
              type="button"
              fullWidth
              variant="contained"
              onClock={handle}
              sx={{ mt: 3, mb: 2 }}
            >
              Submit filter
            </Button>
              </ListItem>
              <Divider/>
              <ListItem>
              <Autocomplete
                disablePortal
                id="combo-box-demo"
                defaultValue={filter.area}
                options={areas}
                inputValue={filter.area}
                aria-label="area"
                onInputChange={(event, value)=>{
                  setFilter({...filter,["area"]:value})
                  console.log(filter)
                }}
                sx={{ width: 300 }}
                renderInput={(params) => <TextField {...params} label="Areas" />}
              />
              </ListItem>
            </List>
            <Divider />
            <List sx={{}}>
              {/* {['All mail', 'Trash', 'Spam'].map((text, index) => (
                <ListItem key={text} disablePadding>
                  <ListItemButton>
                    <ListItemIcon>
                      {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
                    </ListItemIcon>
                    <ListItemText primary={text} />
                  </ListItemButton>
                </ListItem>
              ))} */}
              <ListItem>
              <Autocomplete
                disablePortal
                id="level"
                
                options={levels}
                inputValue={filter.level}
                onInputChange={(event, value)=>{
                  setFilter({...filter,["level"]:value})
                  console.log(filter)
                }}
                sx={{ width: 300 }}
                renderInput={(params) => <TextField {...params} label="Levels" />}
              />
              
              </ListItem>
              <ListItem>
              <Autocomplete
                disablePortal
                id="view"
                defaultValue={filter.view}
                options={views}
                inputValue={filter.view}
                onInputChange={(event, value)=>{
                  setFilter({...filter,["view"]:value})
                  console.log(filter)
                }}
                sx={{ width: 300 }}
                renderInput={(params) => <TextField {...params} label="Views" />}
              />
              </ListItem>
              <ListItem>
              <Autocomplete
                disablePortal
                id="dayPart"
                // defaultValue={filter.dayPart}
                options={dayParts}
                inputValue={filter.dayPart}
                onInputChange={(event, value)=>{
                  setFilter({...filter,["dayPart"]:value})
                  console.log(filter)
                }}
                sx={{ width: 300 }}
                renderInput={(params) => <TextField {...params} label="Day Parts" />}
              />
              </ListItem>
              <ListItem>
              <Autocomplete
                disablePortal
                id="company"
                // defaultValue={filter.view}
                options={companies}
                inputValue={filter.company}
                onInputChange={(event, value)=>{
                  setFilter({...filter,["company"]:value})
                  console.log(filter)
                }}
                sx={{ width: 300 }}
                renderInput={(params) => <TextField {...params} label="Companies" />}
              />
              </ListItem>
              <ListItem>
              <Button
              type="button"
              fullWidth
              variant="contained"
              onClick={handleFilterSubmit}
              sx={{ mt: 3, mb: 2 }}
            >
              Submit filter
            </Button>
              </ListItem>
            </List>
            {/* <Divider/> */}
            <List>
              
            </List>
          {/* </Drawer> */}
          </Paper>
          <Box>
            <Grid container gap={2}>
              {(props.tracks!==null&&props.tracks!==undefined&&props.tracks.length>0)?props.tracks.map((track:any)=>{
                return(<Grid xs={12} md={3} key={track.id}>
                  <CardTrack track={track} myTrack={false}  hasToken={token!==undefined&&token!==null&&token!==""}/>
                </Grid>);
              }):<></>}
              </Grid>
          </Box>
        </Box>

        {/* <Stack spacing={2} alignItems={'center'}>
          <Typography>Page: {page}</Typography>
          <Pagination count={10} page={page} onChange={handleChange} />
        </Stack> */}
        </>
}
